css:
:root {
  font-size: 16px;
}
.settings-view .package-readme {
  font-size: 1.25em;
}
.settings-view .package-readme h1 {
  font-size: 2em;
  margin-top: 1.5em;
}
.settings-view .package-readme h2 {
  font-size: 1.75em;
  margin-top: 1.5em;
}
.settings-view .package-readme h3 {
  font-size: 1.5em;
  margin-top: 1.75em;
}
.settings-view .package-readme h4 {
  font-size: 1.25em;
  margin-top: 1.25em;
}
.settings-view .package-readme h1,
.settings-view .package-readme h2,
.settings-view .package-readme h3,
.settings-view .package-readme h4 {
  color: rgba(203, 205, 210, 0.6);
}
.settings-view .package-readme a {
  color: #2196f3;
}
.settings-view .package-readme hr {
  border-color: rgba(203, 205, 210, 0.5);
}
.settings-view .package-readme blockquote {
  border-left-color: rgba(203, 205, 210, 0.5);
}
.settings-view .package-readme pre {
  margin-bottom: 1em;
}
.settings-view .package-readme img {
  max-width: 100%;
}
.settings-view .package-readme table {
  display: block;
  margin-bottom: 1em;
  width: 100%;
  overflow: auto;
  word-break: normal;
}
.settings-view .package-readme table th {
  font-weight: bold;
  text-align: center;
}
.settings-view .package-readme table th,
.settings-view .package-readme table td {
  padding: 6px 13px;
  border: 1px solid rgba(0, 0, 0, 0.1);
}
.settings-view .package-readme table tr {
  border-top: 1px solid rgba(0, 0, 0, 0.1);
  background-color: transparent;
}
.settings-view .package-readme table tr:nth-child(2n) {
  background-color: rgba(0, 150, 136, 0.1);
}
.settings-view .package-readme kbd {
  display: inline-block;
  padding: .3em .4em;
  font-size: .8em;
  line-height: 1;
  color: rgba(203, 205, 210, 0.6);
  vertical-align: middle;
  background-color: rgba(26, 26, 26, 0);
  border: solid 1px rgba(0, 0, 0, 0.1);
  border-bottom-color: rgba(0, 0, 0, 0.1);
  border-radius: 0.125rem;
  box-shadow: inset 0 -1px 0 rgba(0, 0, 0, 0.1);
}
